A Prairie Home Companion, February 15, 2014 Show #1433: &quot;Deep in the Heart&quot;

This week on A Prairie Home Companion with Garrison Keillor, we'll rebroadcast a show from April 2013 at the Bass Concert Hall in Austin, Texas. Asleep at the Wheel perform &quot;Miles and Miles of Texas,&quot; Kat Edmonson sings &quot;Lucky,&quot; and the Texas Tornados play &quot;Mendocino.&quot; In Lake Wobegon, Pastor Liz makes house calls to hear the town's complaints.
